    html {
      line-height: 1.15;
      -webkit-text-size-adjust: 100%;
      box-sizing: border-box;
      height: 100%;
      font-size: 10px;
      -webkit-tap-highlight-color: transparent
    }
    
    body {
      margin: 0;
      display: flex;
      flex-direction: column;
      justify-content: space-between;
      min-width: 320px;
      min-height: 100vh;
      font-size: 14px;
      line-height: 1.38em;
      font-family: "TT Norms Pro", "Arial", sans-serif;
      color: #333;
      word-wrap: break-word;
      background-color: #2d2d44
    }
    
    a {
      background-color: transparent;
      color: #3527b6;
      text-decoration: none
    }
    
    img {
      border-style: none;
      max-width: 100%;
      height: auto
    }
    
    button,
    input {
      font-family: inherit;
      font-size: 100%;
      line-height: 1.15;
      margin: 0
    }
    
    button,
    input {
      overflow: visible
    }
    
    button {
      text-transform: none
    }
    
    [type=button] {
      -webkit-appearance: button
    }
    
    [type=search] {
      -webkit-appearance: textfield;
      outline-offset: -2px
    }
    
    [type=search]::-webkit-search-decoration {
      -webkit-appearance: none
    }
    
    ::-webkit-file-upload-button {
      -webkit-appearance: button;
      font: inherit
    }

    @-ms-viewport {
      width: device-width
    }
    
    @viewport {
      width: device-width
    }
    
    html *,
    html::after,
    html::before {
      box-sizing: inherit
    }
    
    .link {
      color: #3527b6;
      text-decoration: none
    }
    
    .link:hover,
    a:hover {
      color: #302683;
      text-decoration: underline
    }
    
    .link:focus,
    a:focus {
      color: #302683;
      text-decoration: underline;
      outline: thin dotted;
      outline: 5px auto -webkit-focus-ring-color
    }
    
    .sr-only {
      position: absolute;
      width: 1px;
      height: 1px;
      margin: -1px;
      padding: 0;
      border: 0;
      clip: rect(0, 0, 0, 0);
      -webkit-clip-path: inset(100%);
      clip-path: inset(100%)
    }
    
    .sr-only {
      overflow: hidden
    }
    
    .icon-arrows {
      width: 67px
    }
    
    .icon-arrows svg {
      position: absolute;
      top: 0;
      left: 0;
      height: 100%
    }
    
    .page-header {
      position: relative
    }
    
    .page-header {
      z-index: 11;
      min-height: 60px;
      color: #fff;
      background-color: #2d2d44
    }
    
    .page-header:hover {
      z-index: 12
    }
    
    .page-header:focus-within {
      z-index: 12
    }
    
    .page-header a:not(.button) {
      color: #fff
    }
    
    .page-header a:not(.button):hover {
      color: #8f8f9b;
      text-decoration: none
    }
    
    .page-header a:not(.button):focus {
      color: #8f8f9b;
      text-decoration: none
    }
    
    .page-header__inner {
      display: block;
      width: 100%;
      max-width: 1440px;
      margin: 0 auto;
      padding-right: 10px;
      padding-left: 10px
    }
    
    .page-header__top {
      position: relative;
      z-index: 2;
      display: flex;
      flex-direction: row;
      justify-content: flex-start
    }
    
    .page-header__logo {
      display: none;
      flex: 0 0 auto;
      height: 60px
    }
    
    .page-header__logo img {
      display: block;
      width: 80px;
      height: 36px;
      margin: auto 0
    }
    
    .main-nav__list--adaptive .main-nav__item--logo .main-nav__link:focus img,
    .main-nav__list--adaptive .main-nav__item--logo .main-nav__link:hover img,
    .page-header__logo:focus img,
    .page-header__logo:hover img,
    span.main-nav__link:focus svg,
    span.main-nav__link:hover svg {
      opacity: .5
    }
    
    .main-menu__link svg {
      display: inline-block;
      width: 24px;
      height: 24px;
      vertical-align: middle;
      opacity: .5;
      fill: #fff
    }
    
    .main-menu li {
      margin: 0
    }
    
    .main-menu {
